import React from 'react'
import Card from '../commons/Card';

const Content = ({popMovies}) => {
  return(
    <div className="content">
    {popMovies.map((movie)=>
      <div key={movie.id}> 
        <a></a>{movie}
        </div>)}
    </div>
  )
}

export default Content
